function submitUserAnswer(userAnser) {
  //if user answer is already submitted do nothing
  if(typeof submitUserAnswerOnlyOnce[currentQuestion] !="undefined") { console.log("answer already submitted"); return;};
  
  averageTimeSpentPerQuestion = averageTimeSpentPerQuestion + Date.now() - timeSpentPerQuestionStart;
  console.log(averageTimeSpentPerQuestion);
  timeSpentPerQuestionStart = 0;
  submitUserAnswerOnlyOnce[currentQuestion] = userAnser;

  console.log('answer submitted' + currentQuestion);
  //  console.log("inside submitUserAnswer");
  //userAnser = $("#userAnswer").val();
  userAnswers[currentQuestion] = userAnser;
  if(userAnser == questions[currentQuestion][2]) {
      if(!mutedTracks) {
        correctAnswerSound();  
//        console.log('sound on');
      }
      $("#correct").show();
      $("#wrong").hide();
  } else {
    if(operation == "Addition") {   //for addition both a & b are considered
      //increment no of occurances of each number by 1 in noOfWrongs array
      if(questions[currentQuestion][0] == questions[currentQuestion][1]) {  //increment only once if both a & b are same in the equation a + b = c
        noOfWrongs[questions[currentQuestion][0]] = noOfWrongs[questions[currentQuestion][0]] + 1;
      } else {   //increment both if both a & b are different in the equation a + b = c
        noOfWrongs[questions[currentQuestion][0]] = noOfWrongs[questions[currentQuestion][0]] + 1;
        noOfWrongs[questions[currentQuestion][1]] = noOfWrongs[questions[currentQuestion][1]] + 1;
      }
    } else if(operation == "Subtraction") {
      noOfWrongs[questions[currentQuestion][1]] = noOfWrongs[questions[currentQuestion][1]] + 1;
    } else if(operation == "Multiplication") {
      noOfWrongs[questions[currentQuestion][1]] = noOfWrongs[questions[currentQuestion][1]] + 1;
    } else if(operation == "Division") {
      noOfWrongs[questions[currentQuestion][1]] = noOfWrongs[questions[currentQuestion][1]] + 1;
    } 
    

    // $("#wrong").show();
      if(!mutedTracks) {
        wrongAnswerSound();  
      }
      // $("#wrong").html('<div id="correctanswer"></div>');
      $("#userAnswer").css({
        // '-webkit-box-shadow':'inset 0px 0px 0px 4px #ff9999',
        // '-moz-box-shadow':'inset 0px 0px 0px 4px #ff9999',
        // 'box-shadow':'inset 0px 0px 0px 4px #fff9999',
        'border-color':'#ff9999',
        'border-width':'2px',
        'color':'#ff9999',
      });
    $("#correctanswer").html(' ');
    $("#correctanswer").html("<span class='correct-word'>Correct</span> <span class='answer-word' style='display:block;'>Answer</span> <span class='correct-answer-small'>" + questions[currentQuestion][2] + "</span>");
    if(currentQuestion + 6 < noOfQuestions) {  
    // insert the wrong question to question bank after 5 questions, so that user will get the same question again after 5 questions
      //console.log("question repeated at " + (currentQuestion+6) + "is: " + questions[currentQuestion][0] + "+" +questions[currentQuestion][1] );
      questions.splice(currentQuestion+6,0,questions[currentQuestion]);
    }
    $('#correct').hide();
    $('.correctanswer').hide();
  }
    
  if(operation == "Addition") {   //for addition both a & b are considered
    //increment no of occurances of each number by 1 in noOfOccurances array
    if(questions[currentQuestion][0] == questions[currentQuestion][1]) {
      noofOccurances[questions[currentQuestion][0]] = noofOccurances[questions[currentQuestion][0]] + 1;
    } else {
      noofOccurances[questions[currentQuestion][0]] = noofOccurances[questions[currentQuestion][0]] + 1;
      noofOccurances[questions[currentQuestion][1]] = noofOccurances[questions[currentQuestion][1]] + 1;    
    } 
  } else if(operation == "Subtraction") { //for subtraction only b is considered from a-b = c
    noofOccurances[questions[currentQuestion][1]] = noofOccurances[questions[currentQuestion][1]] + 1; 
  } else if(operation == "Multiplication") { //for multiplication only b is considered from a*b = c
    noofOccurances[questions[currentQuestion][1]] = noofOccurances[questions[currentQuestion][1]] + 1; 
  } else if(operation == "Division") { //for division only b is considered from a/b = c
    noofOccurances[questions[currentQuestion][1]] = noofOccurances[questions[currentQuestion][1]] + 1; 
  } 

  
//  console.log("currentQuestion: "+ currentQuestion);
  if(currentQuestion+1 == noOfQuestions && userAnser == "-1") {  //If user didnt answer last question before timer is done, then display results screen
//    console.log("inside currentQuestion+1 " + currentQuestion+1);
    //clearInterval(mytimedQuestionsInterval);
    $('.needs-practice-text, #screen3_gametype').html(' ');//removing needs practice text
    showResults();

  } else if(currentQuestion+1 < noOfQuestions) {   //display next question
    if(timePerQuestion == "30" || timePerQuestion == "15" || timePerQuestion == "5") {
      $('#timer').pietimer('reset');
      $this.find('.percent').html(0);
    }
    delayForNextQuestion = 2000;
//     alert("yahoo, !mutedTracks!");
    if(userAnser == questions[currentQuestion][2] ) {
      delayForNextQuestion = 500;
    } 
    setTimeout(function() {
        if(timePerQuestion == "30" || timePerQuestion == "15" || timePerQuestion == "5") {
//          console.log("inside 30sec or 4sec timed questions");
          //clearInterval(mytimedQuestionsInterval);
          if(currentQuestion+1 <= noOfQuestions) {  //display if next question exists
            currentQuestion++;
            displayNextQuestion();
          $("#questionTimerArea").html('<div id="timer"></div>');
          $('#timer').pietimer({
            timerSeconds: timePerQuestionsInterval,
            color: '#8aeded',
            fill: '#8aeded',
            showPercentage: false,
            callback: function() {
              $('#timer').stop().hide();
                //alert("yahoo, timer is done!");
                $('#timer').pietimer('reset');
                timedQuestions();
                $this.find('.percent').html(0);
            } 
          });
//            displayTimer(timePerQuestionsInterval-1);
            //mytimedQuestionsInterval = setInterval(timedQuestions, timePerQuestionsInterval * 1000);
          }
        } else {
          currentQuestion++;
          displayNextQuestion();
        }
        /*currentQuestion++;
        displayNextQuestion();
        */
        
    }, delayForNextQuestion); 
  } else {   // all questions are displayed, so display view results 
      $("#submit").hide();
      $('#clear').hide();
      $("#userAnswer").blur();
      $("#results").show();
  }
      
}


