function printCertificate(correctAnswers, totalQuestions, operation, operationMessage, name,characterName) {
  
  ga('send', {
    'hitType': 'event',          // Required.
    'eventCategory': "Print Certificate",   // Required.
    'eventAction': operation,      // Required.
    'eventLabel': characterName,
    'eventValue': 1,
    'nonInteraction': 1
  });
  
  var doc = new jsPDF("l", "pt", "a4");
  doc.setProperties({
    title: 'Certificate',
  });
  
  printCertificateHeaders(doc,characterName);
  doc.setFont('helvetica');
  doc.setFontType("normal");
  doc.setFontSize(12);
  
  var correctAnswersMessage = "out of";
  //var operationMessage = "MULTIPLICATION" +  " Between " + "20-50";
  //var name = "ABCDDDD XYZEEEFFFFFFFFF";
  //name = "AB CD";
  var d = new Date();
  var months = ['January', 'February', 'March', 'April', 'May', 'June', 'July', 'August', 'September', 'October', 'November', 'December'];
  var certificateDate = months[d.getMonth()] + " " + ordinal_suffix_of(d.getDate())+ ", " + d.getFullYear();

  doc.setFontType("bold");
  doc.setFontSize(35);
  if(correctAnswers.length==1) {
    doc.text(417, 245, correctAnswers);
  } else {
    doc.text(405, 245, correctAnswers);  
  }
  
  doc.setFontSize(15);
  doc.text(405, 262, correctAnswersMessage);
  doc.setFontSize(35);
  doc.text(405, 296, totalQuestions);
  //doc.text(35, rowHeight, score + " out of " + noOfQuestions);
  doc.setFontSize(17);
  pointX = (842/2) - (operationMessage.length/2) * 9.5;
  doc.text(pointX, 329, operationMessage);
  doc.setFontSize(45);
  var namelength = name.length;
  pointX = (842/2) - (namelength/2) * 28;
  doc.text(pointX, 447, name.toUpperCase());

  doc.setFontSize(16);
  pointX = (842/2) - (certificateDate.length/2) * 9;
  doc.text(pointX, 530, certificateDate);

  //doc.output('dataurlnewwindow');
  var string = doc.output('datauristring');
  var iframe = "<iframe width='100%' height='100%' src='" + string + "'></iframe>"
  var x = window.open();
  x.document.open();
  x.document.write(iframe);
  x.document.close();


}



