//onclick event of print blank questions from screen1
$(document).on("click", "#print-text", function() {
  range_values = $("#range").val();
  range = range_values.split("-");
  low = parseInt(range[0]);
  high = parseInt(range[1]);

  operation_range = low + '-' + high;
  if(low == high) {  //this is for times tables
    operation_range = low + "'s";
  } else if(low == 1 && high == 2) {
    operation_range = "1’s, 2’s, 5’s, 10’s";
  } else if(low == 1 && high == 100) {
    operation_range = "Products to 100";
  }

  noOfQuestions = parseInt($("#questions").val());
  
  initializeQuestions();
  printBlankQuestions();  
 
});

function printBlankQuestions() {

  var doc = new jsPDF("1", "mm", "a4");
  doc.setProperties({
    title: 'Quiz:' + operation,
  });
  var background_image_questions = "data:image/jpeg;base64,";
  if(noOfQuestions == 20) {
    var background_image_questions ="data:image/jpeg;base64,";
  } else if(noOfQuestions == 30) {
    var background_image_questions ="data:image/jpeg;base64,";
  } 
  doc.addImage(background_image_questions, 'JPEG', 10, 10, 200, 250);
  doc.setFont('helvetica');
  doc.setFontType("normal");
  doc.setFontSize(12);
  //doc.setTextColor(57,147,153);
  
  doc.setFontSize(12);
  doc.text(35, 63, operation + ": " + operation_range );
  
  doc.setFontSize(16);
  pos = 100;
  rowHeight = 70;
  rowHeightIndex = 0;
  for(i=0;i<noOfQuestions;i++) {

    rowHeight = rowHeight + (rowHeightIndex%2?0:11);
    doc.text(35 + (rowHeightIndex%2?70:0), rowHeight,  questions[i][0] + operationSymbolResults + questions[i][1] + " =");

    if(i >0 && (i+1  <noOfQuestions) && ( (i+1) % 30 == 0) ) {    //create new page after every 25 questions
      doc.addPage(); 
      printHeaders(doc);
      rowHeight = 63;     //initialize rowHeight to 87 on new page 
      rowHeightIndex = 0;
    } else {
      rowHeightIndex ++;
    }

  }
  
  ga('send', {
    'hitType': 'event',          // Required.
    'eventCategory': "Print the Quiz",   // Required.
    'eventAction': operation,      // Required.
    'eventLabel': document.title,
    'eventValue': 1,
    'nonInteraction': 1
  });
  //doc.output('dataurlnewwindow');
  var string = doc.output('datauristring');
  var iframe = "<iframe width='100%' height='100%' src='" + string + "'></iframe>"
  var x = window.open();
  x.document.open();
  x.document.write(iframe);
  x.document.close();


  // Save the PDF
  //doc.save('test-results.pdf');

}




